window.bookSummaryJSON = "<p>The Paladins are still short one of their number for them to finally be considered a complete fighting force—the thirteen Champions of the gods.</p> <p>Hence, Ahren and his friends, make their way onto the Ice Fields in the far south, following what scant clues there are in their efforts to track down the man considered to be the father of all Forest Guardians and who was last seen hunting down the fearsome dragon, Four Claws. An odyssey on sea and ice awaits them—and they know full well that HE, WHO FORCES will be putting up ferocious resistance in his desire to see them fall at the last hurdle . . .</p>"; 
